import React from "react";
import LoginForm from '../components/loginform';
import Footer from '../components/footer';
import { Container } from "react-bootstrap";


const LoginPage = () => {
  return (
    <div className="login-page">
      <LoginForm />
      <Footer />
    </div>
  );
};

export default LoginPage;
